css:
atom-text-editor .line.github-editorCommentHighlight {
  background-color: #3f3b63;
}
atom-text-editor .line.github-editorCommentHighlight.cursor-line {
  background-color: rgba(125, 86, 141, 0.46);
}
.gutter[gutter-name="github-comment-icon"] {
  width: 1.4em;
}
.github-editorCommentGutterIcon.decoration {
  width: 100%;
}
.github-editorCommentGutterIcon.react-atom-decoration {
  width: 100%;
  text-align: center;
  padding: 0 3.75px;
}
.github-editorCommentGutterIcon button {
  padding: 0;
  border: none;
  background: none;
  vertical-align: middle;
}
.github-EditorComment-omitted {
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #22253d;
  border-radius: 3px;
  padding: 15px;
  margin: 7.5px 0;
}
.github-EditorComment-omitted p {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  margin: 3.75px;
}
.github-EditorComment-omitted button {
  margin-left: 15px;
}
